#include <vector>
#include <string>
#include <sstream>
#include <iostream>
#include <algorithm>
#include <cctype>
 
using namespace std;
 
class FunctionDependency
{
public: vector<string> 
      scriptingOrder(vector<string> funcs,vector<string> depends)
    {
      vector<string>  retu;
      int flag[50][50];
      int depe[50];
      int temp,j,i;
      memset(flag,0,sizeof(flag));
      memset(depe,0,sizeof(depe));
      for(i=0;i<funcs.size();i++)
      {
        istringstream is(depends[i]);
        while(is>>temp)
        {
          if(flag[i][temp]==0)
          {
            flag[i][temp]=1;
            depe[i]++;
          }
        }
      }
      string cur="";
      int index=-1;
      for(i=0;i<funcs.size();i++)
      {
        cur="";
        for(j=0;j<funcs.size();j++)
        {  
          if(depe[j]==0)
          {
            if(cur=="")
            {
              cur=funcs[j];
              index=j;
            }
            else if(funcs[j]<cur)
            {
              cur=funcs[j];
              index=j;
            }
          }
        }
        retu.push_back(cur);
        depe[index]=-1;
        for(j=0;j<funcs.size();j++)
        {
          if(flag[j][index]==1)
          {
            flag[index][j]=0;
            depe[j]--;
 
          }
        }
      }
      return retu;
 
    }
 
};

